                  '<p><strong>VIL DU INTERVIEWES OM EREOLEN?</strong></p><p>&nbsp;</p><p>Bruger du eReolen, og vil du være med til at forbedre vores kommunikation på de sociale medier?</p><p>Har du lyst til at deltage i et fokusgruppeinterview på Dokk1 i Aarhus den 10. februar?</p><p>- VI KVITTERER MED ET GAVEKORT PÅ 400 KR. TIL BØGER</p><p>&nbsp;</p><div class="text_exposed_show"><p>Det tager ca. 2 timer, og vi byder på kaffe/te og en lille snack undervejs.</p><p><strong>- Gruppe under 30 år fra kl. 10-12<br>- Gruppe over 30 år fra kl. 12.30-14.30</strong></p><p>Vi vil gerne bede om din hjælp, fordi vi er i gang med at få udviklet en ny strategi for for-midling på de sociale medier, så vi kan forbedre vores tilbud til brugerne.</p><p><img src="data:image/png;base64," alt="" /></p><p><strong>INFORMATION</strong><br>I fokusgruppen skal vi tale om eReolen og om digitale bøger, men først til selve fokusgruppen får du mere at vide om, hvad der skal tales om. Du skal ikke forberede dig på noget, og der er ingen krav om teknisk viden osv.</p><p>I fokusgruppen vil du sammen med de andre deltagere blive bedt om at forholde dig til en række spørgsmål. Her skal du bare svare fra hjertet og give udtryk for præcis, hvad du selv mener. Hvis du er uenig med nogle af de andre deltagere, skal du endelig give udtryk for din uenighed.</p><p>Du behøver ikke at medbringe noget til fokusgruppen. Der vil være papir og skriveredskaber i lokalet, hvis du har brug for at notere tanker eller overvejelser undervejs.</p><p>Hvis du har spørgsmål, eller du gerne vil melde dig til fokusgruppen, er du velkommen til at kontakte os i vores Facebook-indbakke eller på mail: <a href="mailto:emmal@aarhus.dk">emmal@aarhus.dk</a>.&nbsp;<br>Vedlæg din e-mailadresse og lidt om dig selv &ndash; din alder, beskæftigelse, om du har hjemmeboende børn, hvor meget du benytter eReolen mv.</p></div><p>&nbsp;</p><p>Originally published by eReolen.</p>',
